eldSize\":\"1\",\"requiredField\":true,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"<p>2. Do you consume healthy or unhealthy fats? Give examples.</p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"30895f8b-9bc1-4046-8dbc-6b83cc1e78a9\"},{\"params\":{\"inputFieldSize\":\"1\",\"requiredField\":true,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"<p>3. Do you make sure to consume foods from the the Dairy group? Give examples.</p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"2ee3c7b7-8a28-4c87-8393-edc848d5a442\"},{\"params\":{\"inputFieldSize\":\"1\",\"requiredField\":true,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"<p>4. Do you consume foods from the Protein group on a daily basis? Give examples.</p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"8db580d2-cd9c-45e4-8fd6-ea78afdde722\"},{\"params\":{\"inputFieldSize\":\"1\",\"requiredField\":true,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"<p>5. Do you make sure to eat vegetables every day? Give examples.</p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"01044b75-8890-4091-aa3d-3d2a92656a76\"},{\"params\":{\"inputFieldSize\":\"1\",\"requiredField\":true,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"<p>6. Do you eat fruits every day? Give examples.</p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"c3408464-28b5-43c8-8bb7-0dd2fb1393eb\"},{\"params\":{\"inputFieldSize\":\"1\",\"requiredField\":true,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"<p>7. Do you regularly consume foods from the Grain group? Give examples.</p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"353eb8c4-d7e4-42a0-87aa-b96f3f6b7be6\"},{\"params\":{\"inputFieldSize\":\"1\",\"requiredField\":true,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"<p>8. What do you conclude? Is your diet healthy and balanced or not?</p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"5dbde962-6fc1-4488-940c-8462442ca034\"},{\"params\":{\"inputFieldSize\":\"10\",\"requiredField\":true,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"<p><strong>Now combine all your answers to form a well-written paragraph. Write your paragraph on the lines below.</strong></p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"23834fd9-212f-4552-b9ec-74018fc823c8\"}],\"helpTextLabel\":\"Guidelines\",\"helpText\":\"<p><strong>Step 1</strong>: Observe My Plate.</p>\\n\\n<p><strong>Step 2:</strong> Write the first sentence, in which you give your opinion; state whether you think your diet is balanced and healthy or not.</p>\\n\\n<p><strong>Step 3</strong>: Answer each of the questions.</p>\\n\\n<p><strong>Step 4:</strong> Combine all your answers in one paragraph and write it in the box that appears below.</p>\\n\\n<p><strong>Step 5</strong>: Use connecting words to connect your ideas and sentences (and, also, in addition, moreover, for example, such as).</p>\\n\"},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Questions\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Questions\"},\"subContentId\":\"5f00abe9-de1c-4ba4-898e-4a8d8ac0c0c7\"},{\"params\":{\"elementList\":[{\"params\":{\"text\":\"<p>After observing the food pyramid and thinking about my own diet, I would say that my diet is not very balanced. I tend to consume unhealthy fats, such as fried foods and sugary snacks, which I know aren't good for me. I often forget to include dairy products, such as milk or yogurt in my daily meals. While I do eat foods from the protein group, it's not an every day occurance, and sometimes it's in the form of processed meats. I don't always make sure to eat vegetables, although I like some of them. Fruits are also hit and miss for me, and I don't eat them every day. I do consume foods from the grain group, such as bread and pasta, but I wonder if sometimes, I eat too much. Generally speaking, I'd say my diet is not as healthy and balanced as it should be according to the criteria located in the Food Pyramid and MyPlate guidelines.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"220a8e99-d07b-4c7b-a069-350ba9a56f1d\"}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Sample Answer\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Sample Answer\"},\"subContentId\":\"05da470b-a4af-4629-83a5-c69a35d600ab\"}],\"i10n\":{\"previousLabel\":\"Previous\",\"nextLabel\":\"Next\",\"closeLabel\":\"Close\"}},\"library\":\"H5P.DocumentationTool 1.8\",\"metadata\":{\"contentType\":\"Documentation Tool\",\"license\":\"U\",\"title\":\"Writing- My Diet-\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Writing- My Diet-\"},\"subContentId\":\"9e93643c-eeef-45a1-a882-96084a14e35d\"},\"useSeparator\":\"disabled\"}]}","library":"H5P.Column 1.16","contentUrl":".","metadata":{"license":"CC BY-NC-ND","title":"Focus on Writin
